// SPDX-License-Identifier: MIT

pragma solidity ^0.7.6;
pragma abicoder v2;

import "@uniswap/v3-periphery/contracts/libraries/LiquidityAmounts.sol";
import "@uniswap/v3-core/contracts/libraries/TickMath.sol";
import "@uniswap/v3-core/contracts/libraries/FullMath.sol";
import "@uniswap/v3-core/contracts/libraries/FixedPoint128.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import "@uniswap/v3-periphery/contracts/interfaces/INonfungiblePositionManager.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "./UniSwapV3Pending.sol";
import "../interfaces/PositionNFTUtil.sol";

contract PositionNFTManager is UniSwapV3Pending, Ownable {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;
    using PositionNFTUtil for PositionNFTUtil.Position;

    mapping(address => bool) public whiteList;

    constructor(address _factory) UniSwapV3Pending(_factory) {}

    modifier onlyWhiteList() {
        require(whiteList[msg.sender] || msg.sender == address(this), "1");
        _;
    }

    /* ========== OWNER ========== */

    function updateWhiteList(address user, bool status) external onlyOwner {
        whiteList[user] = status;
    }

    /* ========== VIEW ========== */

    function getTotalAmounts(uint256 tokenId, uint8 _performanceFee)
        external
        view
        returns (uint256, uint256)
    {
        if (tokenId > 0) {
            NftInfo memory nftInfo = getNftInfo(tokenId);
            address poolAddress = PoolAddress.computeAddress(
                factory,
                PoolAddress.getPoolKey(
                    nftInfo.token0,
                    nftInfo.token1,
                    nftInfo.fee
                )
            );
            return
                _getTotalAmounts(
                    poolAddress,
                    _performanceFee,
                    nftInfo,
                    tokenId
                );
        } else {
            return (0, 0);
        }
    }

    function _getTotalAmounts(
        address poolAddress,
        uint8 _performanceFee,
        NftInfo memory nftInfo,
        uint256 tokenId
    ) private view returns (uint256 total0, uint256 total1) {
        if (nftInfo.liquidity > 0) {
            // Pool OBJ
            IUniswapV3Pool pool = IUniswapV3Pool(poolAddress);
            (uint160 sqrtRatioX96, , , , , , ) = pool.slot0();
            (total0, total1) = LiquidityAmounts.getAmountsForLiquidity(
                sqrtRatioX96,
                TickMath.getSqrtRatioAtTick(nftInfo.lowerTick),
                TickMath.getSqrtRatioAtTick(nftInfo.upperTick),
                nftInfo.liquidity
            );
            // get Pending
            (uint256 pending0, uint256 pending1) = getPendingAmounts(tokenId);
            total0 = total0.add(pending0);
            total1 = total1.add(pending1);
            if (_performanceFee > 0) {
                total0 = total0.sub(pending0.div(_performanceFee));
                total1 = total1.sub(pending1.div(_performanceFee));
            }
        }
    }

    /* ========== BASE FUNCTION ========== */

    /// @dev Low Level
    function _burnLiquidity(uint256 tokenId, uint128 _liquidity)
        internal
        returns (uint256 amount0, uint256 amount1)
    {
        INonfungiblePositionManager.DecreaseLiquidityParams
            memory param = INonfungiblePositionManager.DecreaseLiquidityParams({
                tokenId: tokenId,
                liquidity: _liquidity,
                amount0Min: 0,
                amount1Min: 0,
                deadline: block.timestamp
            });
        (amount0, amount1) = positionManager.decreaseLiquidity(param);
        (, NftInfo memory nftInfo) = _positionInfo(tokenId);
        emit ChangeLiquidity(
            msg.sender,
            nftInfo.lowerTick,
            nftInfo.upperTick,
            amount0,
            amount1,
            _liquidity,
            false
        );
    }

    /// @dev Low Level
    function _collect(
        uint256 tokenId,
        address to,
        uint128 amount0,
        uint128 amount1
    ) internal returns (uint256 collect0, uint256 collect1) {
        INonfungiblePositionManager.CollectParams
            memory params = INonfungiblePositionManager.CollectParams({
                tokenId: tokenId,
                recipient: to,
                amount0Max: amount0,
                amount1Max: amount1
            });
        (collect0, collect1) = positionManager.collect(params);
    }

    /* ========== SENIOR FUNCTION ========== */

    /// @dev amount0Min & amount1Min avoid revert of uniswapV3.mint()
    function addAll(
        uint256 tokenId,
        uint256 balance0,
        uint256 balance1
    )
        external
        returns (
            uint256 amount0,
            uint256 amount1,
            uint128 liquidity
        )
    {
        require(tokenId > 0, "NFT not exist");
        (address poolAddress, NftInfo memory nftInfo) = _positionInfo(tokenId);
        liquidity = getLiquidityForAmounts(
            IUniswapV3Pool(poolAddress),
            nftInfo.lowerTick,
            nftInfo.upperTick,
            balance0,
            balance1
        );
        if (liquidity > 0) {
            _pay(nftInfo.token0, nftInfo.token1, balance0, balance1);
            _approve(poolAddress, balance0, balance1);
            INonfungiblePositionManager.IncreaseLiquidityParams
                memory params = INonfungiblePositionManager
                    .IncreaseLiquidityParams({
                        tokenId: tokenId,
                        amount0Desired: balance0,
                        amount1Desired: balance1,
                        amount0Min: 0,
                        amount1Min: 0,
                        deadline: block.timestamp
                    });
            (, amount0, amount1) = positionManager.increaseLiquidity(params);
            _back(tokenId);
            emit ChangeLiquidity(
                msg.sender,
                nftInfo.lowerTick,
                nftInfo.upperTick,
                amount0,
                amount1,
                liquidity,
                true
            );
        }
    }

    /// @dev amount0Min & amount1Min avoid revert of uniswapV3.mint()
    function mintAll(
        address poolAddress,
        uint256 balance0,
        uint256 balance1,
        int24 lowerTick,
        int24 upperTick,
        address to
    )
        external
        returns (
            uint256 tokenId,
            uint256 amount0,
            uint256 amount1,
            uint128 liquidity
        )
    {
        IUniswapV3Pool pool = IUniswapV3Pool(poolAddress);
        liquidity = getLiquidityForAmounts(
            pool,
            lowerTick,
            upperTick,
            balance0,
            balance1
        );
        if (liquidity > 0) {
            _mintPay(pool, balance0, balance1);
            _approve(poolAddress, balance0, balance1);
            INonfungiblePositionManager.MintParams
                memory mintParams = INonfungiblePositionManager.MintParams({
                    token0: pool.token0(),
                    token1: pool.token1(),
                    fee: pool.fee(),
                    tickLower: lowerTick,
                    tickUpper: upperTick,
                    amount0Desired: balance0,
                    amount1Desired: balance1,
                    amount0Min: 0,
                    amount1Min: 0,
                    recipient: to,
                    deadline: block.timestamp
                });
            (tokenId, liquidity, amount0, amount1) = positionManager.mint(
                mintParams
            );
            _back(tokenId);
            emit ChangeLiquidity(
                msg.sender,
                lowerTick,
                upperTick,
                amount0,
                amount1,
                liquidity,
                true
            );
        }
    }

    /// @dev Burn some liquidity And Collect include Fee
    function burn(uint256 tokenId, uint128 _liquidity)
        public
        onlyWhiteList
        returns (
            uint256 amount0,
            uint256 amount1,
            uint256 fee0,
            uint256 fee1
        )
    {
        if (_liquidity > 0) {
            address nftOwner = positionManager.ownerOf(tokenId);
            require(msg.sender == nftOwner, "not owner");
            (fee0, fee1) = _burnLiquidity(tokenId, _liquidity);
            // Collect
            (amount0, amount1) = _collect(
                tokenId,
                nftOwner,
                type(uint128).max,
                type(uint128).max
            );
            fee0 = amount0 - fee0;
            fee1 = amount1 - fee1;
        }
    }

    function burnAll(uint256 tokenId)
        external
        onlyWhiteList
        returns (
            uint256 amount0,
            uint256 amount1,
            uint256 fee0,
            uint256 fee1
        )
    {
        // Read Liq
        (uint128 liquidity, , ) = PositionNFTUtil._positionInfo(tokenId);
        (amount0, amount1, fee0, fee1) = burn(tokenId, liquidity);
        // Burn UToken
        positionManager.burn(tokenId);
    }

    function _approve(
        address poolAddress,
        uint256 amt0,
        uint256 amt1
    ) internal {
        IUniswapV3Pool pool = IUniswapV3Pool(poolAddress);
        if (amt0 > 0) {
            IERC20(pool.token0()).approve(address(positionManager), amt0);
        }
        if (amt1 > 0) {
            IERC20(pool.token1()).approve(address(positionManager), amt1);
        }
    }

    function _pay(
        address token0,
        address token1,
        uint256 amt0,
        uint256 amt1
    ) internal {
        IERC20(token0).safeTransferFrom(msg.sender, address(this), amt0);
        IERC20(token1).safeTransferFrom(msg.sender, address(this), amt1);
    }

    function _mintPay(
        IUniswapV3Pool pool,
        uint256 amt0,
        uint256 amt1
    ) internal {
        IERC20(pool.token0()).safeTransferFrom(msg.sender, address(this), amt0);
        IERC20(pool.token1()).safeTransferFrom(msg.sender, address(this), amt1);
    }

    function _back(uint256 tokenId) internal {
        (, NftInfo memory nftInfo) = _positionInfo(tokenId);
        IERC20 token0 = IERC20(nftInfo.token0);
        IERC20 token1 = IERC20(nftInfo.token1);
        uint256 amt0 = token0.balanceOf(address(this));
        uint256 amt1 = token1.balanceOf(address(this));
        if (amt0 > 0) {
            token0.safeTransfer(msg.sender, amt0);
        }
        if (amt1 > 0) {
            token1.safeTransfer(msg.sender, amt1);
        }
    }

    function getLiquidityForAmounts(
        IUniswapV3Pool pool,
        int24 lowerTick,
        int24 upperTick,
        uint256 balance0,
        uint256 balance1
    ) internal view returns (uint128 liquidity) {
        // Calculate Liquidity
        (uint160 sqrtRatioX96, , , , , , ) = pool.slot0();
        liquidity = LiquidityAmounts.getLiquidityForAmounts(
            sqrtRatioX96,
            TickMath.getSqrtRatioAtTick(lowerTick),
            TickMath.getSqrtRatioAtTick(upperTick),
            balance0,
            balance1
        );
    }

    event ChangeLiquidity(
        address indexed vaultAddress,
        int24 lowerTick,
        int24 upperTick,
        uint256 amount0,
        uint256 amount1,
        uint128 liquidity,
        bool add
    );
}
